        Expert's Guide
      </Button>
      <Button variant="outlined" sx={customButtonStyle}>
        Comment
      </Button>
      <Button variant="outlined" sx={customButtonStyle}>
        Share
      </Button>
    </div>
  </CardActions>
        </Card>
      </div>
    </div>
  );
}
